import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Set the base URL for axios requests
axios.defaults.baseURL = 'http://localhost:5000';

const Tenders = () => {
  const [state, setState] = useState('');
  const [district, setDistrict] = useState('');
  const [department, setDepartment] = useState('');
  const [dropdownOptions, setDropdownOptions] = useState({
    states: [],
    districts: [],
    departments: [],
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [tenderDetails, setTenderDetails] = useState(null);

  useEffect(() => {
    fetchStates();
  }, []);

  const fetchStates = async () => {
    try {
      const response = await axios.get('/tenders/states');
      setDropdownOptions(prev => ({ ...prev, states: response.data.states }));
    } catch (err) {
      setError('Error fetching states');
      console.error('Error fetching states:', err);
    }
  };

  const handleStateChange = async (e) => {
    const selectedState = e.target.value;
    setState(selectedState);
    setDistrict('');
    setDepartment('');
    if (selectedState) {
      try {
        const [districtsResponse, departmentsResponse] = await Promise.all([
          axios.get(`/tenders/districts/${selectedState}`),
          axios.get(`/tenders/departments/${selectedState}`)
        ]);
        setDropdownOptions(prev => ({
          ...prev,
          districts: districtsResponse.data.districts,
          departments: departmentsResponse.data.departments
        }));
      } catch (err) {
        setError('Error fetching districts or departments');
        console.error('Error fetching districts or departments:', err);
      }
    } else {
      setDropdownOptions(prev => ({ ...prev, districts: [], departments: [] }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    try {
      const response = await axios.get('/tenders/list', {
        params: { state, district, department }
      });
      setTenderDetails(response.data.tenders);
    } catch (err) {
      setError('Error fetching tender details');
      console.error('Error fetching tender details:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container mt-5 pt-4">
      <h1 className="mb-4">Select State</h1>
      <form onSubmit={handleSubmit}>
        <div className="row mb-3">
          <div className="col-md-6">
            <div className="form-group">
              <label htmlFor="state" className="form-label">State:</label>
              <select
                id="state"
                name="state"
                className="form-select"
                required
                value={state}
                onChange={handleStateChange}
              >
                <option value="">Select a State</option>
                {dropdownOptions.states.map(s => (
                  <option key={s} value={s}>{s}</option>
                ))}
              </select>
            </div>
          </div>
          {dropdownOptions.districts.length > 0 && (
            <div className="col-md-6" id="district-container">
              <div className="form-group">
                <label htmlFor="district" className="form-label">District:</label>
                <select
                  id="district"
                  name="district"
                  className="form-select"
                  value={district}
                  onChange={(e) => setDistrict(e.target.value)}
                >
                  <option value="">Select a District</option>
                  {dropdownOptions.districts.map(d => (
                    <option key={d} value={d}>{d}</option>
                  ))}
                </select>
              </div>
            </div>
          )}
          {dropdownOptions.departments.length > 0 && (
            <div className="col-md-6" id="department-container">
              <div className="form-group">
                <label htmlFor="department" className="form-label">Department:</label>
                <select
                  id="department"
                  name="department"
                  className="form-select"
                  required
                  value={department}
                  onChange={(e) => setDepartment(e.target.value)}
                >
                  <option value="">Select a Department</option>
                  {dropdownOptions.departments.map(d => (
                    <option key={d} value={d}>{d}</option>
                  ))}
                </select>
              </div>
            </div>
          )}
        </div>
        <button type="submit" className="btn btn-primary">Submit</button>
      </form>

      {loading && <p>Loading...</p>}
      {error && <p className="text-danger">{error}</p>}

      {tenderDetails && tenderDetails.length > 0 && (
        <div className="container my-5 pt-4">
          <h2 className="text-center mb-4"><strong>Tender Details</strong></h2>
          {tenderDetails.map((tender, index) => (
            <div key={index} className="card mb-4">
              <div className="card-body">
                <table className="table table-bordered table-striped">
                  <thead className="thead-dark">
                    <tr>
                      <th scope="col">Field</th>
                      <th scope="col">Details</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <th scope="row">Tender ID</th>
                      <td>{tender.tender_id}</td>
                    </tr>
                    <tr>
                      <th scope="row">Title</th>
                      <td>{tender.title}</td>
                    </tr>
                    <tr>
                      <th scope="row">Organization Name</th>
                      <td>{tender.org_name}</td>
                    </tr>
                    <tr>
                      <th scope="row">Category</th>
                      <td>{tender.category}</td>
                    </tr>
                    <tr>
                      <th scope="row">Price</th>
                      <td>{tender.price}</td>
                    </tr>
                    <tr>
                      <th scope="row">Address</th>
                      <td>{tender.address}</td>
                    </tr>
                    <tr>
                      <th scope="row">Closing Date</th>
                      <td>{tender.closing_date}</td>
                    </tr>
                    <tr>
                      <th scope="row">BOQ</th>
                      <td>
                        {tender.boq && tender.boq.length ? (
                          <a href={tender.boq} className="btn btn-primary" download>Download BOQ</a>
                        ) : (
                          <span className="btn btn-primary">No BOQ Found</span>
                        )}
                      </td>
                    </tr>
                  </tbody>
                </table>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Tenders;
